Note that int is optional in declarations such as 

unsigned x;  
unsigned int x;  //equivalent

long long z;  
long long int z; //equivalent

Some of the questions require you to OMIT the \int\"."

A vector's current size can be accessed using the function vctr.size().

A typical way to increase size is:

v.resize(v.size()+1);

When you insert a printf statement for debugging purposes, you should always follow that statement with

fflush(stdout);

Explanation later.

Java is object-oriented and all code is included in classes. Your first program will contain only one class with which you are not going to create objects and the bulk of the code will be included in the method called main with the header shown in activity 1.2.1.  So your programs will include always the following piece of code:

public class ClassName {

     public static void main(String[] args){

            // your code

     }
}

Note: In this textbook the method main always end with statement return;. This statement can be omitted and I will always omit it but some exercises in the textbook may require it.

To print in hex, use: cout << std::hex;
To print in decimal, use: cout << std::dec;
(You also need to #include &lt;iomanip&gt;)

When printing uint8_t values, they often print as characters instead of numbers. To avoid this, use:

uint8_t x = 20;
cout << +x;

