Some pertinent distinctions:

Use underscore separators in naming of variables and functions, all lowercase, not camelcase.
      sum_of_grades, not sumOfGrades

Curly brackets begin on a line by themlesves
     if( a < b )
     {
          //do this
      }
      else
      {
           //do that
       }

Lines of code should not exceed 80 characters
